import React from "react";
import { Box, Heading, Center } from "@chakra-ui/react";
export const Chat = () => {
  return (
    <div>
      <Box
        minH="100vh"
        py="12"
        px={{
          base: "4",
          lg: "8",
        }}
        bgGradient="linear(to-l, #7928CA, #FF0080)"
      >
        <Box maxW="md" mx="auto">
          <Center>
            <Heading color="white" fontSize="6xl" fontWeight="extrabold">
              AI Chat Therapy
            </Heading>
          </Center>
        </Box>
      </Box>
    </div>
  );
};
